import React from 'react'

 function AboutForm() {
  return (
    <div className='about'>

    <p>
    Welcome to Codeex! Explore our website to learn about programming in JavaScript, HTML, and ReactJS. 
    Visit our 'About' page to learn more about our mission and the services we offer. 
    Join us on our adventure to become better programmers!
    </p>

    </div>
  )
}




export default  AboutForm;
